eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   events: () => (/* binding */ events)\n/* harmony export */ });\nconst events = [\n    {\n        eventname: \"PressNote011225\",\n        category: \"\",\n        country: \"International\",\n        type: \"news\",\n        date: \"12/01/25\",\n        author: \"\",\n        title_en: \"ENDGAME launches its first educational escape room to teach how to detect misinformation about food and health\",\n        title_sr: \"ENDGAME lansira svoju prvu edukativnu escape room igru za učenje prepoznavanja dezinformacija o hrani i zdravlju\",\n        title_es: \"ENDGAME lanza su primer escape room educativo para enseñar a detectar la desinformación sobre alimentación y salud\",\n        description_en: \"We have launched “The Click Trap,” an educational escape room designed to combat disinformation and strengthen media literacy among young people. It includes a teacher’s guide and will be piloted in schools across Spain, Finland, and Serbia, with versions available in multiple languages.\",\n        description_sr: \"Evropski projekat ENDGAME pokrenuo je “The Click Trap”, edukativnu escape room igru namenjenu borbi protiv dezinformacija i jačanju medijske pismenosti među mladima. Uz igru dolazi i vodič za nastavnike, a biće testirana u školama u Španiji, Finskoj i Srbiji, uz verzije dostupne na više jezika.\",\n        description_es: \"Lanzamos “The Click Trap”, un escape room educativo para combatir la desinformación y fortalecer la alfabetización mediática juvenil. Incluye una guía docente y será probado en colegios de España, Finlandia y Serbia, con versiones disponibles en varios idiomas.\",\n        image: \"/assets/images/EndgameBackground.png\",\n        imagePosition: \"bottom\",\n        htmlbody_en: `    \n<p>The European project <b>ENDGAME</b> (Escaping New Disinformation through Gamified Cross-Border Media Literacy Education), led by the <b><a href=\"https://www.uef.fi/fi\" target=\"_blank\">University of Eastern Finland</a></b> (UEF, Finland) and consisting of the <b><a href=\"https://www.upm.es/\" target=\"_blank\">Technical University of Madrid</a></b> (UPM, Spain), the <b><a href=\"https://www.metropolitan.ac.rs/en/about-metropolitan-university/\" target=\"_blank\">Metropolitan University of Belgrade</a></b> (BMU, Serbia), <b><a href=\"https://faktabaari.fi/in-english/\" target=\"_blank\">Faktabaari</a></b> (Faktabaari, Finland), <b><a href=\"https://novinarska-skola.org.rs/\" target=\"_blank\">Novi Sad School of Journalism</a></b> (FNT, Serbia) and <b><a href=\"http://Maldita.es\" target=\"_blank\">Fundación Maldita.es</a></b> (Maldita.es, Spain), has developed an educational escape room, <a href=\"https://endgameproject.github.io/escaperooms/theClickTrap\"><b>“The Click Trap”</b></a>, along with <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" >a teacher’s guide</a> designed to help educators work on media literacy and critical thinking in the classroom. Both resources will be tested over the coming months in schools in Spain, Finland and Serbia. This is the first of the three escape rooms that the project will develop between 2025 and 2027.</p>\n<br/>\n<h2>A game to escape misinformation</h2>\n\n<p>In “The Click Trap”, the player takes on the role of a janitor who infiltrates the influencer agency “ConnectNow”, which is promoting <b>GlowUp+</b>, a dietary supplement with questionable health benefits. Over 45 minutes, with the help of Lena, an influencer from the agency who also wants to expose its bad practices, the player must gather the necessary information to dismantle this misinformation campaign before the evidence is destroyed.</p>\n\n<p>The escape room presents situations based on real cases of misinformation about food and health, a topic that is particularly sensitive among European youth. Throughout the game, students learn to recognise manipulation techniques, assess the reliability of sources and reflect on the economic factors that fuel misinformation.</p>\n<br/>\n<h2>A guide to bring the game into the classroom</h2>\n\n<p>The escape room is accompanied by <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" > a didactic guide</a> providing context on what misinformation on social media is, along with activities to carry out before and after playing the game, designed to activate critical thinking, as well as a step-by-step explanation intended to support the integration of the escape room into classrooms and learning spaces across Europe.</p>\n\n<p>In the coming months, pilot tests of “The Click Trap” will be carried out in schools in Finland, Serbia and Spain to collect feedback and improve the experience. The project expects to reach nearly 1000 students across the three countries. In addition, the game is available on <a href=\"https://endgameproject.github.io/escaperooms/theClickTrap\">the project’s website</a> in English, Spanish, Serbian and Finnish so it can be played virtually, helping increase the escape room’s impact across Europe.</p>\n  `,\n        htmlbody_sr: `\n    <p>Evropski projekat ENDGAME (Escaping New Disinformation through Gamified Cross-Border Media Literacy Education), koji predvodi <b><a href=\"https://www.uef.fi/fi\" target=\"_blank\">Univerzitet Istočne Finske (UEF, Finska)</a></b> a u kojem učestvuju <b><a href=\"https://www.upm.es/\" target=\"_blank\">Tehnički univerzitet u Madridu (UPM, Španija)</a></b>, <b><a href=\"https://www.metropolitan.ac.rs/en/about-metropolitan-university/\" target=\"_blank\">Metropolitan univerzitet Beograd </a></b> (BMU, Srbija), <b><a href=\"https://faktabaari.fi/in-english/\" target=\"_blank\">Faktabaari</a></b> (Faktabaari, Finska), <b><a href=\"https://novinarska-skola.org.rs/\" target=\"_blank\">Novosadska novinarska škola</a></b> (FNT, Srbija) i <b><a href=\"http://Maldita.es\" target=\"_blank\">Fundación Maldita.es</a></b> (Maldita.es, Španija), razvio je edukativnu escape room video igru, <a href=\"https://endgameproject.github.io/escaperooms/theClickTrap\"><b>“The Click Trap”</b></a>, zajedno sa <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" >vodičem za nastavnike</a> osmišljenim da pomogne edukatorima da rade na medijskoj pismenosti i kritičkom razmišljanju u učionici. Ova dva resursa biće testirana tokom narednih meseci u školama u Španiji, Finskoj i Srbiji. Ovo je prvi od tri escape room-a koje će biti razvijena na projektu između 2025. i 2027. godine.</p>\n<br/>\n<h2>Igra za razotkrivanje dezinformacija</h2>\n<p>U igri “The Click Trap”, igrač preuzima ulogu domara koji se infiltrira u influensersku agenciju “ConnectNow”, koja promoviše GlowUp+, dijetetski suplement sa sumnjivim zdravstvenim benefitima. Tokom 45 minuta, uz pomoć Lene, influenserke iz agencije koja takođe želi da razotkrije lošu praksu agencije, igrač mora prikupiti potrebne informacije kako bi razotkrio ovu kampanju dezinformacija pre nego što dokazi budu uništeni.</p>\n\n<p>Escape room prikazuje situacije zasnovane na stvarnim slučajevima dezinformacija o hrani i zdravlju, temi koja je posebno osetljiva među mladima u Evropi. Kroz igru, učenici uče da prepoznaju tehnike manipulacije, procene pouzdanost izvora i razmišljaju o ekonomskim faktorima koji podstiču širenje dezinformacija.</p>\n<br/>\n<h2>Vodič za primenu igre u učionici</h2>\n\n<p>Uz Escape room igru dolazi i <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" >didaktički vodič</a> koji objašnjava prirodu dezinformacija na društvenim mrežama i nudi niz aktivnosti pre i posle igre, osmišljenih da podstaknu kritičko razmišljanje. Vodič takođe sadrži detaljno objašnjenje korak po korak, namenjeno podršci integrisanju escape room-a u učionice i obrazovne prostore širom Evrope. </p>\n\n<p>Tokom narednih meseci, pilot testiranje igre “The Click Trap” biće sprovedeno u školama u Finskoj, Srbiji i Španiji kako bi se prikupile povratne informacije i unapredilo korisničko iskustvo. Projekat očekuje da će obuhvatiti skoro 1000 učenika u tri zemlje. Pored toga, igra je dostupna na web sajtu web-sajtu projekta na engleskom, španskom, srpskom i finskom jeziku, tako da se može igrati virtuelno, što povećava njen uticaj širom Evrope.</p>\n`,\n        htmlbody_es: `\n    <p>El proyecto europeo <b>ENDGAME</b> (Escaping New Disinformation through Gamified Cross-Border Media Literacy Education), liderado por la <b><a href=\"https://www.uef.fi/fi\" target=\"_blank\">University of Eastern Finland (UEF, Finlandia)</a></b> y formado por la <b><a href=\"https://www.upm.es/\" target=\"_blank\">Universidad Politécnica de Madrid (UPM, España)</a></b>, la <b><a href=\"https://www.metropolitan.ac.rs/en/about-metropolitan-university/\" target=\"_blank\">Universidad Metropolitana de Belgrado</a></b> (BMU, Serbia), <b><a href=\"https://faktabaari.fi/in-english/\" target=\"_blank\">Faktabaari</a></b> (Faktabaari, Finlandia), la <b><a href=\"https://novinarska-skola.org.rs/\" target=\"_blank\">Escuela de Periodismo de Novi Sad</a></b> (FNT, Serbia) y <b><a href=\"http://Maldita.es\" target=\"_blank\">Fundación Maldita.es</a></b> (Maldita.es, España), ha desarrollado el escape room educativo <a href=\"https://endgameproject.github.io/escaperooms/theClickTrap\"><b>“The Click Trap”</b></a>, acompañado de <a href=\"https://docs.google.com/document/d/1QMLHAEaBetoKYbuLx2xALDGbi1-96IgJ/export?format=pdf\" target=\"_blank\" >una guía para docentes</a> diseñada para ayudar a los educadores a trabajar la alfabetización mediática y el pensamiento crítico en el aula. Ambos recursos serán testeados durante los próximos meses en colegios de España, Finlandia y Serbia. Esta es el primero de tres escape rooms que el proyecto estará desarrollando entre 2025 y 2027.</p>\n<br/>\n<h2>Un juego para escapar de la desinformación</h2>\n<p>En “The Click Trap”  el jugador asume el papel de un conserje que se infiltra en la agencia de influencers \"ConnectNow\", la cual está promocionando GlowUp+, un suplemento dietético de dudosos beneficios para la salud. Durante 45 minutos, con la ayuda de Lena, una influencer que forma parte de la agencia pero que también quiere denunciar sus malas prácticas, el jugador deberá reunir la información necesaria para desmantelar esta campaña de desinformación antes de que se destruyan las pruebas.</p>\n\n<p>El escape room plantea situaciones basadas en casos reales de desinformación sobre alimentación y salud, un tema especialmente sensible entre la juventud europea. A lo largo del juego, el estudiantado aprenderá a reconocer técnicas de manipulación, evaluar la fiabilidad de las fuentes y a reflexionar sobre los factores económicos que fomentan la desinformación.\n\n<br/>\n<h2>Una guía para llevar el juego al aula</h2>\n\n<p>El escape room se acompaña de <a href=\"https://docs.google.com/document/d/1QMLHAEaBetoKYbuLx2xALDGbi1-96IgJ/export?format=pdf\" target=\"_blank\" >una guía didáctica</a> con contexto sobre qué es la desinformación en redes y con actividades para realizar antes y después del juego. Están diseñadas para activar el pensamiento crítico y una explicación paso a paso para la integración del escape room en aulas y espacios formativos de toda Europa. </p>\n<p>En los próximos meses se realizarán pruebas piloto de “The Click Trap” en colegios de Finlandia, Serbia y España para recabar opiniones y mejorar la experiencia. Se espera alcanzar cerca de 1000 estudiantes a lo largo del proyecto entre los tres países. Además, el juego se encuentra disponible en la página del proyecto en inglés, español, serbio y finalandés para que se pueda jugar de manera virtual y aumentar el impacto del escape room en toda Europa. </p>\n\n<br/>\n<h2>Pilotaje educativo en España</h2>\n<p>En España, el primer testeo de “The Click Trap” será en Toledo, en el IES Peñas Negras en Mora, donde el equipo de Maldita.es realizará sesiones presenciales con todas las clases de 1º de ESO. Este testeo, que tendrá lugar en Mora los días 9 y 10 de diciembre, permitirá evaluar de primera mano cómo el escape room contribuye a mejorar las competencias de pensamiento crítico del alumnado más joven y recoger sugerencias para optimizar la experiencia educativa. </p>\n\n<p>Cualquier centro educativo interesado en participar en el testeo del escape room puede ponerse en contacto con el equipo de <a href=\"https://maldita.es\" target=\"_blank\">Maldita.es</a> a través del correo <a href=\"mailto:educa@maldita.es\">educa@maldita.es</a>.  Las sesiones se realizan de manera presencial y se priorizará la colaboración con centros ubicados en áreas accesibles para el equipo de Fundación Maldita.es.</p>\n`,\n        // other\n        externalLinkJoin: \"\",\n        keywords: [\n            \"Event Launch\"\n        ],\n        socialLinks: [\n            {\n                name: \"Instagram\",\n                icon: `InstagramIcon`,\n                url: \"https://www.instagram.com/endgame.project\",\n                handle: \"endgame.project\"\n            },\n            {\n                name: \"X (Twitter)\",\n                icon: `TwitterIcon`,\n                url: \"https://twitter.com/endgame_project\",\n                handle: \"endgame_project\"\n            },\n            {\n                name: \"TikTok\",\n                icon: `TikTokIcon`,\n                url: \"https://www.tiktok.com/@endgame.project\",\n                handle: \"@endgame.project\"\n            },\n            {\n                name: \"LinkedIn\",\n                icon: `LinkedInIcon`,\n                url: \"https://www.linkedin.com/company/end-game-project-477149364\",\n                handle: \"end-game-project\"\n            }\n        ]\n    },\n    {\n        eventname: \"PressNote200525\",\n        category: \"\",\n        country: \"International\",\n        type: \"news\",\n        date: \"05/20/25\",\n        author: \"\",\n        title_en: \"ENDGAME: a new EU project to strengthen media literacy through educational escape rooms\",\n        title_sr: \"ENDGAME: novi projekat EU za jačanje medijske pismenosti kroz obrazovne sobe za bekstvo\",\n        title_es: \"ENDGAME: un nuevo proyecto de la UE para fortalecer la alfabetización mediática a través de escape rooms educativas\",\n        title_fi: \"ENDGAME – uusi EU-hanke vahvistamaan medialukutaitoa opetuksellisten pakopelien kautta\",\n        description_en: \"Six organisations from Finland, Serbia, and Spain join forces to fight disinformation among young people using game-based learning\",\n        description_sr: \"Šest organizacija iz Finske, Srbije i Španije udružuju snage u borbi protiv dezinformacija među mladima kroz učenje zasnovano na igri\",\n        description_es: \"Seis organizaciones de Finlandia, Serbia y España unen fuerzas para combatir la desinformación entre los jóvenes utilizando el aprendizaje basado en juegos\",\n        description_fi: \"Kuusi järjestöä Suomesta, Serbiasta ja Espanjasta yhdistävät voimansa nuorten disinformaation torjumiseksi pelipohjaisen oppimisen avulla\",\n        image: \"/newsENDGAME_imagePlaceholder.png\",\n        htmlbody_en: `\n  <p>\n    The European project <strong>ENDGAME</strong> – Escaping New Disinformation through Gamified cross-border Media literacy Education - has officially kicked off with a consortium online meeting marking the launch of this 24-month initiative. Funded by the Creative Europe Programme (CREA-CROSS-2024-MEDIALITERACY), ENDGAME aims to empower European youth with the skills to critically engage with information, identify disinformation, and navigate digital media environments responsibly.\n  </p>\n\n  <h2 className='news'>Project Partners</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong> – (Finland) Project coordinator</li>\n    <li><strong>Faktabaari</strong> (Finland)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n    <li><strong>Universidad Politécnica de Madrid (UPM)</strong> (Spain)</li>\n    <li><strong>Fundación Maldita.es</strong> (Spain)</li>\n  </ul>\n\n  <h2>About the Project</h2>\n  <p>\n    ENDGAME leverages the power of educational escape rooms to simulate real-life media scenarios where players must solve puzzles and complete challenges while building their critical thinking and media literacy skills. These innovative tools will address pressing topics such as AI-generated disinformation, personal data risks, and manipulated content, and will be tailored to each partner country through participatory design processes involving local communities and stakeholders.\n  </p>\n\n  <p>\n    During the kick-off meeting, held online in March 2025, the partners defined the strategic roadmap for the project’s first phase, including the co-creation of country-specific narratives and the organisation of participatory workshops in Finland, Serbia and Spain. The escape rooms will be playable in schools, public spaces and online, complemented by competitions, teacher training events, streaming activities on platforms like Twitch, and presentations at conferences and educational fairs.\n  </p>\n\n  <p>\n    ENDGAME has a total budget of <strong>€712,831.86</strong>, with <strong>€498,982.30</strong> co-funded by the European Union. The project will reach hundreds of young people, educators and other stakeholders through hands-on, inclusive activities, while also generating research-based insights into media literacy gaps via learning analytics.\n  </p>\n\n  <h2>Follow us on Social Media!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles López Pernas – \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a> – \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_sr: `<p>\n    Evropski projekat ENDGAME – Escaping New Disinformation through Gamified cross-border Media literacy Education - zvanično je započet konsorcijumskim online sastankom, čime je obeleženo pokretanje ove 24-mesečne inicijative. Finansiran kroz program Creative Europe (CREA-CROSS-2024-MEDIALITERACY), ENDGAME ima za cilj da opremi evropsku omladinu veštinama za kritičko sagledavanje informacija, prepoznavanje dezinformacija i odgovorno kretanje kroz digitalne medijske sadržaje.\n  </p>\n  <h2 className='news'>Projektni partneri:</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong> – (Finska) Koordinator projekta</li>\n    <li><strong>Faktabaari</strong> (Finska)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Srbija)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Srbija)</li>\n    <li><strong>Universidad Politécnica de Madrid (UPM)</strong> (Španija)</li>\n    <li><strong>Fundación Maldita.es</strong> (Španija)</li>\n  </ul>\n  <h2>O projektu</h2>\n  <p>\n  ENDGAME koristi moć edukativnih soba za bekstvo kako bi simulirao scenarije iz stvarnog života u oblasti medija, gde učesnici moraju da rešavaju zagonetke i izvršavaju izazove, istovremeno razvijajući kritičko razmišljanje i medijsku pismenost. Ovi inovativni alati baviće se aktuelnim temama kao što su dezinformacije generisane veštačkom inteligencijom, rizici po lične podatke i manipulisani sadržaji, a biće prilagođeni svakoj partnerskoj zemlji kroz participativni dizajn u saradnji sa lokalnim zajednicama i zainteresovanim stranama.\n  </p>\n  <p>\n  Tokom početnog sastanka, održanog onlajn u martu 2025. godine, partneri su definisali strateški plan za prvu fazu projekta, uključujući zajedničko kreiranje narativa specifičnih za svaku zemlju i organizaciju participativnih radionica u Finskoj, Srbiji i Španiji. Sobe za bekstvo biće dostupne u školama, javnim prostorima i onlajn, a pratiće ih takmičenja, obuke za nastavnike, aktivnosti strimovanja na platformama poput Twitch-a, kao i prezentacije na konferencijama i obrazovnim sajmovima.\n  </p>\n  <p>\n  ENDGAME ima ukupni budžet od 712.831,86 €, od čega je 498.982,30 € sufinansirano od strane Evropske unije. Projekat će obuhvatiti stotine mladih ljudi, edukatora i drugih zainteresovanih strana kroz praktične i inkluzivne aktivnosti, a ujedno će generisati uvide zasnovane na istraživanju o prazninama u medijskoj pismenosti putem analitike učenja.\n  </p>\n  <h2>Pratite nas na društvenim mrežama!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Kontakt</h2>\n  <p>\n    <strong>Koordinacija projekta:</strong> UEF, Sonsoles López Pernas – \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a> – \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>\n  `,\n        htmlbody_es: `<p>\n      El proyecto europeo <strong>ENDGAME</strong> – Escaping New Disinformation through Gamified cross-border Media literacy Education - ha comenzado oficialmente con una reunión en línea del consorcio que marca el lanzamiento de esta iniciativa de 24 meses. Financiado por el Programa Europa Creativa (CREA-CROSS-2024-MEDIALITERACY), ENDGAME tiene como objetivo empoderar a la juventud europea con las habilidades para participar críticamente con la información, identificar la desinformación y navegar por los entornos digitales de manera responsable.\n    </p>\n    <h2 className='news'>Socios del proyecto</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong> – (Finlandia) Coordinador del proyecto</li>\n      <li><strong>Faktabaari</strong> (Finlandia)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politécnica de Madrid (UPM)</strong> (España)</li>\n      <li><strong>Fundación Maldita.es</strong> (España)</li>\n    </ul>\n    <h2>Sobre el proyecto</h2>\n    <p>\n      ENDGAME aprovecha el poder de las escape rooms educativas para simular escenarios reales de medios en los que los jugadores deben resolver acertijos y completar desafíos mientras desarrollan sus habilidades de pensamiento crítico y alfabetización mediática. Estas herramientas innovadoras abordarán temas urgentes como la desinformación generada por IA, los riesgos de datos personales y el contenido manipulado, y se adaptarán a cada país socio a través de procesos de diseño participativo que involucren a las comunidades locales y a las partes interesadas.\n    </p>\n    <p>\n      Durante la reunión de lanzamiento, celebrada en línea en marzo de 2025, los socios definieron la hoja de ruta estratégica para la primera fase del proyecto, que incluye la co-creación de narrativas específicas de cada país y la organización de talleres participativos en Finlandia, Serbia y España. Las escape rooms estarán disponibles para jugar en escuelas, espacios públicos y en línea, complementadas con competiciones, eventos de formación para docentes, actividades de streaming en plataformas como Twitch y presentaciones en conferencias y ferias educativas.\n    </p>\n    <p>\n      ENDGAME cuenta con un presupuesto total de <strong>€712,831.86</strong>, de los cuales <strong>€498,982.30</strong> están cofinanciados por la Unión Europea. El proyecto alcanzará a cientos de jóvenes, educadores y otras partes interesadas a través de actividades prácticas e inclusivas, al tiempo que generará conocimientos basados en la investigación sobre las brechas en alfabetización mediática mediante el análisis del aprendizaje.\n    </p>\n    <h2>¡Síguenos en las redes sociales!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles López Pernas – \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a> – \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_fi: `<p>\n    Eurooppalainen hanke ENDGAME – Escaping New Disinformation through Gamified cross-border Media literacy Education - on virallisesti käynnistynyt verkkotapaamisella, joka toimi lähtölaukauksena tälle 24 kuukautta kestävälle aloitteelle. EU:n Luovan Euroopan ohjelman (CREA-CROSS -2024-MEDIALITERACY) rahoittama ENDGAME pyrkii antamaan eurooppalaisille nuorille taidot kriittiseen informaation käsittelyyn, disinformaation tunnistamiseen sekä vastuulliseen navigointiin digitaalisen median ympäristöissä.\n    </p>\n    <h2 className='news'>Projektikumppanit</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong> – (Suomi) Projektin koordinaattori</li>\n      <li><strong>Faktabaari</strong> (Suomi)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politécnica de Madrid (UPM)</strong> (Espanja)</li>\n      <li><strong>Fundación Maldita.es</strong> (Espanja)</li>\n    </ul>\n    <h2>Projektista</h2>\n    <p>\n      ENDGAME hyödyntää opetuksellisten pakohuoneiden toimivuutta simuloidakseen todellisia mediankäyttöskenaarioita, joissa pelaajien on ratkaistava pulmia ja suoritettava haasteita samalla kehittäen kriittistä ajattelua ja medialukutaitoaan. Nämä innovatiiviset opetuskeinot käsittelevät ajankohtaisia aiheita, kuten tekoälyn tuottamaa disinformaatiota, henkilötietojen riskejä ja manipuloitua sisältöä, ja ne räätälöidään kunkin kumppanimaan tarpeisiin osallistavan suunnittelun prosessien kautta, jotka huomioivat paikalliset yhteisöt ja sidosryhmät.\n  </p>    \n    <p>\n      Kick-off-kokouksessa, joka pidettiin verkossa maaliskuussa 2025, kumppanit määrittelivät strategisen tiekartan projektin ensimmäiselle vaiheelle mukaanlukien maakohtaisten narratiivien yhteiskehittely ja osallistavien työpajojen järjestäminen Suomessa, Serbiassa ja Espanjassa. Pakohuoneet tulevat olemaan pelattavissa kouluissa, julkisissa paikoissa ja verkossa, ja niitä täydentävät kilpailut, opettajankoulutustapahtumat, suoratoistona pelautus Twitchissä sekä esitykset konferensseissa ja koulutustapahtumissa.  </p>    \n    <p>\n      ENDGAME-hankkeen kokonaisbudjetti on <strong>712 831,86 €</strong>, josta <strong>498 982,30 €</strong> on Euroopan unionin rahoittamaa. Projekti tavoittaa satoja nuoria, opettajia ja muita sidosryhmiä käytännönläheisten ja osallistavien toimintojen kautta, tuottaen samalla tutkimukseen perustuvia näkemyksiä medialukutaidon tarpeista oppimisanalytikan avulla.\n  </p>\n    <h2>Seuraa meitä sosiaalisessa mediassa!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles López Pernas – \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a> – \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        // other\n        externalLinkJoin: \"\",\n        keywords: [\n            \"Event Launch\"\n        ],\n        socialLinks: [\n            {\n                name: \"Instagram\",\n                icon: `InstagramIcon`,\n                url: \"https://www.instagram.com/endgame.project\",\n                handle: \"endgame.project\"\n            },\n            {\n                name: \"X (Twitter)\",\n                icon: `TwitterIcon`,\n                url: \"https://twitter.com/endgame_project\",\n                handle: \"endgame_project\"\n            },\n            {\n                name: \"TikTok\",\n                icon: `TikTokIcon`,\n                url: \"https://www.tiktok.com/@endgame.project\",\n                handle: \"@endgame.project\"\n            },\n            {\n                name: \"LinkedIn\",\n                icon: `LinkedInIcon`,\n                url: \"https://www.linkedin.com/company/end-game-project-477149364\",\n                handle: \"end-game-project\"\n            }\n        ]\n    },\n    {\n        eventname: \"ParticipatoryDesignWorkshop\",\n        category: \"Workshop\",\n        country: \"International\",\n        type: \"Event\",\n        date: \"05/20/25\",\n        hour: \"15:00 UTC+1\",\n        title_en: \"Designing Educational Escape Rooms to Combat Disinformation\",\n        title_sr: \"Dizajn edukativnih soba za bekstvo za borbu protiv dezinformacija\",\n        title_es: \"Diseño de salas de escape educativas para combatir la desinformación\",\n        title_fi: \"Opetuksellisten pakopelien suunnittelu disinformaation torjumiseksi\",\n        description_en: `Are you an educator, media literacy expert, designer, or game developer aged 18 to 25 — or part of a civil society or media organization? Join us!\nWe invite you to participate in an online international webinar on Tuesday, May 20, at 3:00 PM, where we will co-design the storyline and format of educational escape rooms using a participatory design approach.\nThis two-hour session will bring together experts and young creatives to share their perspectives and collaboratively develop narratives, characters, and puzzles that help youth recognize disinformation and strengthen their critical thinking skills.\nThrough a series of co-design workshops held at several stages of the project, we will define the narrative, format, and themes of the escape rooms in ways that are intrinsically motivating and engaging for the youth — going beyond traditional learning activities. We are committed to involving diverse groups — including individuals from different genders, ethnicities, abilities, and backgrounds — to ensure the visuals and storylines are inclusive, respectful, and relevant to a wide audience.`,\n        description_sr: `Da li ste nastavnik, stručnjak za medijsku pismenost, dizajner ili developer igara uzrasta od 18 do 25 godina — ili deo organizacije civilnog društva ili medijske organizacije? Pridružite nam se!\nPozivamo vas da učestvujete na međunarodnom vebinaru koji će se održati onlajn u utorak, 20. maja, u 15:00 časova, gde ćemo zajednički osmišljavati priču i format edukativnih soba za bekstvo koristeći pristup participativnog dizajna.\nOva dvočasovna sesija okupiće stručnjake i mlade kreativce kako bi podelili svoje perspektive i zajedno razvili narative, likove i zagonetke koje pomažu mladima da prepoznaju dezinformacije i ojačaju svoje veštine kritičkog mišljenja.\nKroz niz radionica participativnog dizajna koje će se održavati u različitim fazama projekta, definisaćemo narativ, format i teme soba za bekstvo na način koji motiviše i angažuje mlade — prevazilazeći granice tradicionalnih obrazovnih aktivnosti. Posvećeni smo uključivanju različitih grupa — uključujući osobe različitog pola, etničke pripadnosti, sposobnosti i porekla — kako bismo osigurali da vizuali i priče budu inkluzivni, sa poštovanjem predstavljeni i relevantni za široku publiku.`,\n        description_es: `¿Eres educador, experto en alfabetización mediática, diseñador o desarrollador de juegos, o formas parte de una organización de la sociedad civil o de medios de información? ¡Ayúdanos!\nTe invitamos a participar en un seminario web online (en inglés) el martes 20 de mayo a las 15:00 horas, donde co-diseñaremos la narrativa y el formato de escape rooms educativas utilizando un enfoque de diseño participativo.\nEsta sesión de dos horas reunirá a expertos y jóvenes para compartir sus perspectivas y desarrollar de manera colaborativa narrativas, personajes y retos/puzzles que ayuden a los jóvenes a reconocer la desinformación y fortalecer sus habilidades de pensamiento crítico.\nA través de una serie de talleres de co-diseño que se llevarán a cabo en varias etapas del proyecto, definiremos la narrativa, el formato y los temas de las escape rooms de manera que resulten motivadoras y atractivas para los jóvenes, yendo más allá de las actividades de aprendizaje tradicionales. Estamos comprometidos con la inclusión de grupos diversos —incluyendo personas de diferentes géneros, etnias, capacidades y orígenes— para asegurar que los elementos visuales y las historias sean inclusivos, respetuosos y relevantes para una audiencia amplia.`,\n        description_fi: `Oletko opettaja, medialukutaidon asiantuntija, pelisuunnittelija tai -kehittäjä iältäsi 18–25 vuotta, tai työskenteletkö kansalaisjärjestössä tai mediatoimijana? Liity mukaan!\nKutsumme sinut osallistumaan kansainväliseen verkkoseminaariin tiistaina 20. toukokuuta klo 15:00, jossa yhteissuunnittelemme opetuksellisten pakopelien tarinoita ja muotoja osallistavan suunnittelun keinoin.\nTässä kahden tunnin työpajassa asiantuntijat ja nuoret luovat yhdessä tarinoita, hahmoja ja pulmia, jotka auttavat nuoria tunnistamaan misinformaatiota ja vahvistamaan kriittisen ajattelun taitojaan.\nSarjassa eri vaiheisiin ajoittuvia yhteissuunnittelutyöpajoja määrittelemme pakopelien narratiivin, rakenteen ja teemat siten, että ne ovat nuorille sisäisesti motivoivia ja houkuttelevia, ylittäen perinteisten oppimistoimintojen rajat. Olemme sitoutuneet moninaisuuden huomioimiseen — mukaan lukien eri sukupuolet, etnisyydet, toimintakyvyt ja taustat — varmistaaksemme, että visuaaliset elementit ja tarinat ovat inklusiivisia, kunnioittavia ja merkityksellisiä laajalle yleisölle.`,\n        externalLinkJoin: \"https://uef.zoom.us/meeting/register/d-Ok41vZS_W_fMGyBERFAw#/registration\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\",\n            \"Escape room\",\n            \"Participatory design\"\n        ]\n    },\n    {\n        eventname: \"WorkshopFinland\",\n        category: \"Workshop\",\n        country: \"Finland\",\n        type: \"Event\",\n        date: \"05/16/25\",\n        hour: \"12:00 UTC+3\",\n        title_en: \"Misinformation narratives in Finland\",\n        description_en: `We’re inviting participants to take part in a media literacy workshop as part of the EU-funded ENDGAME project. If you are between 18 and 30 years old and are tired of being exposed to misinformation (e.g., related to migrants, climate change, or cryptocurrency), we want to hear your experience! \n\n    In this interactive session, you'll help identify the most pressing misinformation narratives and media literacy challenges facing young people today. The results will be used to design educational escape rooms that train critical thinking and digital resilience.`,\n        externalLinkJoin: \"https://docs.google.com/forms/d/e/1FAIpQLScyhbCM1wKiRlkt-z8dfbtDKazVuA3T2Xh_1fJ3BZJMSWcLtg/viewform\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSerbia\",\n        category: \"Workshop\",\n        country: \"Serbia\",\n        type: \"Event\",\n        date: \"05/14/25\",\n        hour: \"18:00 UTC+1\",\n        title_en: \"Online workshop: Identifying disinformation\",\n        title_sr: \"Virtuelna radionica: Identifikacija dezinformacija\",\n        description_en: ` If you work in journalism or teaching, are a student or work with young people, we need you!\n   \nOn Wednesday, May 14 at 6:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Serbian youth.  \n \nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project.  `,\n        description_sr: `Ako radite u novinarstvu ili nastavi, student ste ili radite sa mladima, potrebni ste nam!\n\nU sredu, 14. maja u 18:00 časova pozivamo vas da učestvujete u jednočasovnoj onlajn sesiji u kojoj ćemo razgovarati, deliti ideje i slušati vaša iskustva kako bismo analizirali digitalne navike i dezinformacije sa kojima se suočavaju mladi u Srbiji.\nU ovoj sesiji, stručnjaci će doprineti svojim razmišljanjima i iskustvom kako bi pomogli u oblikovanju različitih obrazovnih materijala koji će pomoći mladima da prepoznaju dezinformacije i ojačaju svoje kritičko rmišljenje. Želimo da ovi resursi budu zaista korisni, pristupačni i povezani sa stvarnim potrebama društva. Da bismo to postigli, potrebni su nam ljudi poput vas. Vaše prisustvo je ogromna pomoć svima nama koji radimo na ovom projektu. `,\n        externalLinkJoin: \"https://forms.gle/aL2x5URUz1sEbJLaA \",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSpain\",\n        category: \"Workshop\",\n        country: \"Spain\",\n        type: \"Event\",\n        date: \"05/07/25\",\n        hour: \"17:00 UTC+1\",\n        title_en: \"Narratives under the Magnifying Glass: Designing Educational Tools against Disinformation\",\n        title_es: \"Narrativas bajo la Lupa: Diseñando Herramientas Educativas contra la Desinformación\",\n        description_en: `If you work in journalism or teaching, are a student or work with young people, we need you! \n    \nOn Wednesday, May 7 at 5:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Spanish youth.  \n\nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project. `,\n        description_es: `\nSi te dedicas al periodismo o la docencia, eres estudiante o trabajas con jóvenes, ¡te necesitamos! \n    \nEl miércoles 7 de mayo a las 17:00 h (hora Madrid) te invitamos a participar en una sesión online de una hora en la que conversaremos, compartiremos ideas y escucharemos tu experiencia para analizar los hábitos digitales y las narrativas desinformadoras a las que se enfrenta la juventud española.  \n\nEn esta sesión, personas expertas aportarán su opinión y vivencias para ayudar a dar forma a diversos materiales educativos que ayuden a a juventud a reconocer la desinformación y a fortalecer su pensamiento crítico. Queremos que estos recursos sean verdaderamente útiles, accesibles y conectados con las necesidades reales de la sociedad. Para lograrlo, necesitamos contar con personas como tú. Contar contigo es una enorme ayuda para todas las personas que estamos diseñando este proyecto. `,\n        // short description -> eventCard\n        externalLinkJoin: \"https://forms.gle/6HugpAZw7oSqDTc56\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./constants/events.js\n");

